    <Router>
      <Header />
      <Switch>
        <Route path='/stay/:stayId' component={StayDetails} />
        <Route path='/explore' render={() => (<Explore stays={stays} />)} />
        <Route path='/stay' render={() => (<StayDetails stay={[stays[0]]} />)} />
        <Route path='/' component={Home} />
      </Switch>
    </Router>
  );
}

